    data: |
      SELECT + - 22 + - + col1 + - col0 AS col1 FROM tab1 AS cor0 WHERE - col2 NOT BETWEEN + + 5 AND - ( + col1 ) * col0;
  - name: tab1

outputs:
  - name: q10098.out
    data: |
      -112
      -160
      -87
